#version 150
uniform float err;

in vec3 v_normal;
in vec3 v_eye;

out vec4 fragColor;

void main(){
	vec3 normal = normalize(v_normal);
	vec3 eye = normalize(v_eye);

	if(dot(normal,eye) < err){
		fragColor = vec4(0.0,0.0,0.0,1.0);
	}else{
		fragColor = vec4(1.0,1.0,1.0,1.0);
	}
}

